import axios from "axios";

const Validate = async (email, password) => {
  console.log(email);
  const response = await axios
    .post("http://localhost:8081/validationForLogin", { email, password })
    .then(() => {
      if (response) {
        return "success";
      } else {
        console.log("May Be Invalid");
      }
    })
    .catch((err) => {
      console.log("Incorrect Email");
    });
};

export default Validate;
